import React, { useState, useEffect } from 'react';
import { Container, Grid, Box, Typography } from '@mui/material';

const LandingPage = () => {
    const images = [
        'https://via.placeholder.com/1920x1080?text=Freelancing+Opportunities+1',
        'https://via.placeholder.com/1920x1080?text=Freelancing+Opportunities+2',
        'https://via.placeholder.com/1920x1080?text=Freelancing+Opportunities+3',
    ];

    const [currentImageIndex, setCurrentImageIndex] = useState(0);

    // Rotate background images every 5 seconds
    useEffect(() => {
        const interval = setInterval(() => {
            setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
        }, 5000); // Change every 5 seconds

        return () => clearInterval(interval); // Cleanup interval on component unmount
    }, [images.length]);

    return (
        <Box
            sx={{
                position: 'relative',
                paddingTop: '80px', // Adjust for navbar height
                minHeight: '100vh',
                backgroundImage: `url(${images[currentImageIndex]})`,
                backgroundSize: 'cover',
                backgroundPosition: 'center',
                backgroundAttachment: 'fixed',
                transition: 'background-image 1s ease-in-out', // Smooth animation
            }}
        >
            <Container maxWidth="lg">
                <Typography
                    variant="h3"
                    align="center"
                    gutterBottom
                    sx={{
                        fontWeight: 'bold',
                        color: '#1976d2',
                        mb: 4,
                        textShadow: '1px 1px 3px rgba(0,0,0,0.5)',
                    }}
                >
                    Welcome Freelancer!
                </Typography>
                <Typography
                    variant="h6"
                    align="center"
                    gutterBottom
                    sx={{
                        color: '#555',
                        mb: 5,
                    }}
                >
                    Explore opportunities, connect with clients, and build your future.
                </Typography>
                <Grid container spacing={4}>
                    {/* Static Gallery */}
                    <Grid item xs={12} sm={6} md={4}>
                        <Box
                            sx={{
                                position: 'relative',
                                overflow: 'hidden',
                                borderRadius: '16px',
                                boxShadow: '0 8px 24px rgba(0, 0, 0, 0.2)',
                                transition: 'transform 0.3s ease, box-shadow 0.3s ease',
                                '&:hover': {
                                    transform: 'scale(1.05)',
                                    boxShadow: '0 12px 36px rgba(0, 0, 0, 0.3)',
                                },
                            }}
                        >
                            <Box
                                component="img"
                                src="https://via.placeholder.com/800x400?text=Static+Image+1"
                                alt="Gallery Item"
                                sx={{
                                    width: '100%',
                                    height: '100%',
                                    objectFit: 'cover',
                                    transition: 'opacity 0.3s ease-in-out',
                                }}
                            />
                        </Box>
                    </Grid>
                    {/* Repeat more static gallery items as needed */}
                </Grid>
            </Container>
        </Box>
    );
};

export default LandingPage;
